script: |
  super -f tsv -I q8599.sql | sort > q8599.out

vector: true

inputs:
  - name: q8599.sql
    data: |
      pragma pg
      SELECT DISTINCT + + 65 AS col1 FROM tab1 AS cor0 GROUP BY col2, col1 HAVING NOT - MIN ( ALL - 74 ) IS NULL;
  - name: tab1

outputs:
  - name: q8599.out
    data: |
      65
